import React from 'react';
import PropTypes from 'prop-types';
import BubbleGroup from '../WritingPage/components/Bubble';


class MathNoCalcPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      selected: "",
      correct: false,
    }
  }

  mapMathNoCalcAnswers = () => {
    const { sampleAnswers } = this.props;
    return sampleAnswers.map(question => (
      <BubbleGroup key={question.id} question={question} />
    ))
  }

  render() {

    return (
      <div className="slide">
        <div className="row">
          <div className="col s12 l4">
            <ol className="answers-list">
              <li className="answers-list-holder">
                <div className="answer-row row mb-0" >
                  <div className="col col-120">
                    <ul className="answer-list">
                      {this.mapMathNoCalcAnswers()}
                    </ul>
                  </div>
                </div>
              </li>
            </ol>
          </div>
        </div>
      </div>

    )
  }
}

MathNoCalcPage.propTypes = {
  sampleAnswers: PropTypes.object.isRequired,
}
export default MathNoCalcPage;
